/*
high card: (1, 1287)
pair: (1, 13*84) + 4000
two_pair: (2146+1, 2146+1+13*78) + 4000
three of a kind: (0, 13*165) + 8000
straight: (12001, 12010)
flush: (1, 1287) + 16000
full house: (0, 13*16) + 20000
four of a kind: (0, 84*13) + 24000
straight flush: (12001, 12010) + 16000
*/
unsigned int evaluate(uint64_t a, uint64_t b, uint64_t c, uint64_t d,
                      uint64_t e, uint64_t f, uint64_t g) {
  // printf("%16llx, %16llx, %16llx, %16llx, %16llx\n", (long long unsigned)a, (long long unsigned)b, (long long unsigned)c, (long long unsigned)d, (long long unsigned)e);
  uint64_t sum = a + b + c + d + e + f + g;
  unsigned int ranks_1 = (unsigned int) shift_long((0x0001111111111111ul & sum));
  unsigned int ranks_2 = (unsigned int) shift_long((0x0001111111111111ul & (sum>>1)));
  unsigned int has_three = ranks_1 & ranks_2;
  // four of a kind
  if (unlikely(sum & 0x0004444444444444ul)) {
    uint64_t has_four = sum & 0x0004444444444444ul;
    unsigned int has_four_ = (unsigned int) shift_long((has_four>>2));
    unsigned int has_four_kicker = (unsigned int) shift_long(((sum|(sum>>1)) & 0x0001111111111111ul));
    return class_map[has_four_] + kicker_map[has_four_kicker] + 24000; // four of a kind
  }
  // full house
  else if (unlikely(has_three)) {
    unsigned int has_full_house_kicker = ((~ranks_1) & ranks_2) | class_map[0x7fffu^has_three];
    if (has_full_house_kicker) {
      return kicker_map[has_three] * 16 + kicker_map[has_full_house_kicker] + 20000;
    }
  }
  // flush or straight flush
  unsigned int suits = (unsigned int) (sum >> 52);
  unsigned char has_flush = flush_map[suits];
  if (has_flush) {
    uint64_t tmp = (0x8000000000000ul<<has_flush);
    // TODO: may be optimized, since mulplication could be expensive
    sum = a*((tmp&a)!= 0) + b*((tmp&b)!= 0) + c*((tmp&c)!= 0) + d*((tmp&d)!= 0) + e*((tmp&e)!= 0) + f*((tmp&f)!= 0) + g*((tmp&g)!= 0);
    uint64_t ranks = sum & 0x000ffffffffffffful;
    unsigned int rank_unique = (unsigned int) shift_long(((ranks | (ranks>>1)) & 0x0001111111111111ul));
    return class_map[rank_unique] + 16000;
  }
  // straight
  unsigned int rank_unique = (ranks_1 | ranks_2) & 0x7fffu; // assuming not four of a kind
  unsigned int has_straight = class_map[rank_unique];
  if (unlikely(has_straight>1287)) {
    return has_straight;
  }
  // three of a kind
  if (unlikely(has_three)) {
    unsigned int has_three_kicker = (~has_three) & rank_unique;
    return kicker_map[has_three] * 64 + kicker_map[has_three_kicker] + 8000;
  }
  // two pair / pair
  else if (ranks_2) {
    unsigned int has_two = ranks_2;
    unsigned int has_two_kicker = ranks_1 | kicker_map[0x7fffu^has_two];
    //printf("%d %d \n", has_two, class_map[has_two]);
    return class_map[has_two] + kicker_map[has_two_kicker] + 4000;
  } 
  // high card
  else {
    unsigned int has_high_card = has_straight;
    return has_high_card;
  }
}

